import React from "react";
import DataTable from "./DataTable";
import "./Places.css";
import Button from "@mui/material/Button";
import AddIcon from "@mui/icons-material/Add";
import TextField from "@mui/material/TextField";

import { AuthContext } from "../../AuthContext";

const Places = () => {
  const { token } = useContext(AuthContext);
  const tokenValue = String(localStorage.getItem("jwtToken"));
  const [jwtToken, setJwtToken] = token;

  const buttonStyle = {
    backgroundColor: "#1ca395",
  };
  const searchStyle = {
    width: "350px",
  };

  return (
    <div className="places-container">
      <h1> Pet Places </h1>
      <div className="places-actions">
        <TextField label="Search the places..." sx={searchStyle} />
        <Button sx={buttonStyle} variant="contained" startIcon={<AddIcon />}>
          Add Place
        </Button>
      </div>
      <DataTable />
    </div>
  );
};

export default Places;
